import React, { useEffect, useState } from 'react';
import './App.css';

type FontButtonProps = {
  text: string,
  font: {
    displayName: string,
    name: string,
  }
  pressed: boolean,
  onClick: React.MouseEventHandler<HTMLButtonElement>
}

const FontButton = ({ text, font, pressed, onClick }: FontButtonProps) => {
  return (
    <>
      <div>
        <span className='fontName'>
          <button name={font.name} value={font.name} onClick={onClick} disabled={pressed}>
            <div style={{fontFamily: font.name}}>{text}</div>
            <br />
            {font.displayName}
          </button>
        </span>
      </div>
    </>
  );
}

export default FontButton;
